import React, { Component } from 'react';
import Navigationbar from '../navigation';
import '@fortawesome/fontawesome-free/css/all.min.css';
import { Link } from 'react-router-dom';
import { Form, Button, Card, CardGroup, Modal} from 'react-bootstrap';
import axios from 'axios';
import backendServer from '../../backendServer';
import ReactPaginate from 'react-paginate';
import '../restaurant/pagination.css';
// import { getMainCourse } from './getMaincourse';

export class userOrders extends Component {
    constructor(props) {
        super(props);
        this.state = {
            userOrders: [],
            tempUserOrders: [], 
            showModal: false
        };
    }


    componentDidMount() {
        axios.get(`${backendServer}/yelp/order/${localStorage.getItem("user_id")}`)
        .then(res => {
            this.setState({ userOrders: res.data, tempUserOrders: res.data });
        });
    }

    handleOpenModal = () => {
        this.setState({ showModal: true });
        // this.props.getEventRegistrationDetails(arg);
      }

      handleCloseModal = () => {
        this.setState({ showModal: false });
      }


    render () {
        console.log(this.state.tempUserOrders)
        let renderOrders;
        if(this.state.tempUserOrders) {
        // console.log(this.state.yourOrders);
            renderOrders = this.state.tempUserOrders.map(order => {
                if(order.message.length >= 1) {
                return (
                    <div>
                        <p> <b>Order Id</b>: {order._id} </p>
                        <p> <b>Restaurant Name </b>: {order.restName} </p>
                        <p> <b>Date </b>: {order.message[0].date} </p>
                        <p> <b>Time</b>: {order.message[0].time} </p>
                        <Button style={{backgroundColor: "red", color: "white", border: "1px solid red"}}  onClick={this.handleOpenModal} > Chat </Button>
                        <hr />
                        <br/>
                        <br/>
                    </div>
                )
            }
        })
    }

        return (
            <React.Fragment>
                <Navigationbar/>
                <div class="container">
                <div >
                    <center>
                    <h1 style={{margin: "10px", color:"red"}}> All messages </h1>
                    </center>
                    <hr />
                    {renderOrders}
                    <Modal show={this.state.showModal} onHide={this.handleCloseModal}>
                            <Modal.Header closeButton>
                                    <Modal.Title style={{fontSize: "30px"}}>Send a message to </Modal.Title>
                            </Modal.Header>
                            <Modal.Body>
                            <h5> Hi </h5>
                            <h5 style={{float: "right"}}> Hi </h5>
                            <br />
                            <h5> Hi </h5>
                            <h5 style={{float: "right"}}> Hi </h5>
                            <br />
                            <h5> Hi </h5>
                            <h5 style={{float: "right"}}> Hi </h5>
                            <br />
                            <h5> Hi </h5>
                            <input class="form-control input-md" type='text' style={{ height: '70px'}} onChange={this.handleInputChange}/>
                            </Modal.Body>
                            <Modal.Footer>
                                <Button style={{border: "1px solid red", backgroundColor: "red", color: 'white',  width: "100px", borderRadius: '5px'}} onClick = {this.handleSendMessage}>Send</Button>
                            </Modal.Footer>
                        </Modal>
                </div>         
                </div>

            </React.Fragment>
        )
    }

}
export default userOrders;
